import React from 'react';
import './Contact.css';

const Contact = () => {
  return (
    <section id="contact" className="contact">
      <h2>Contact</h2>
      <p>Provide a way for visitors to reach you, such as a contact form, email, or social media links.</p>
    </section>
  );
};

export default Contact;
